INSERT INTO `text` (`id`, `DocumentID`, `RawText`) VALUES
(2, '5d0a017e-8825-4ed8-beb6-65a90dad36a9', 'Однією з характерних рис нових організованих злочинних угруповань стало збільшення рівня насильства, відзначають правоохоронці.\r\n \r\nОрганізовані злочинні угруповання становлять найбільшу загрозу безпеці Євросоюзу, випереджаючи тероризм і міграцію. Про це в середу, 17 квітня, повідомляє Європейська правда з посиланням представників Європолу.\r\n \r\nЗа даними правоохоронців, найбільшими гравцями у злочинному світі є італійські мафіозні угруповання, албанські і східноєвропейські групи, а також мотоциклетні банди. Але азіатські, африканські й американські групи також брали активну участь в організованому злочинному бізнесі в Європі, який оцінюється в 110 млрд євро на рік, і все частіше вони співпрацюють один з одним.\r\n \r\n\"Наразі організована злочинність становить найбільший ризик для внутрішньої безпеки ЄС... Ми повинні разом діяти на міжнародному рівні, так як організовані злочинні угруповання вже роблять це\", - заявив глава Європейського центру з питань організованої злочинності Європолу Ярі Люкка.'),
(3, '39d14aea-7dd1-4793-8010-ecbf8bc95c36', 'Глава італійського управління боротьби з мафією Джузеппе Говернале зазначив, що сицилійська Коза Ностра, калабрийська Ндрангета і неаполітанська Каморра, як і раніше, - найбільші мафіозні клани.\r\n \r\nПоліцейські також відзначають, що однією з характерних рис нових організованих злочинних угруповань стало збільшення рівня насильства.\r\n \r\nУ Швеції, зокрема, спостерігається безпрецедентний сплеск насильства, схожий на \"форму військових дій низької інтенсивності\", заявив високопоставлений співробітник шведської поліції.\r\n \r\nЗа перші три місяці 2019 року в 67 перестрілках загинули 12 осіб. \"Швеція ніколи раніше не бачила таких цифр\", - сказав він.'),
(4, '134e02df-bc87-4de4-914d-7e2a91a388e6', 'Президент Петро Порошенко оголосив про початок міжнародного аудиту держконцерну Укроборонпром. Про це він сказав в середу, 17 квітня, під час зустрічі з представниками громадянського суспільства та експертного середовища, передають Українськi Новини.\r\n\r\n\"Запущено аудит, прийнято рішення уряду, щоб він був профінансований. До аудиту допущена одна з чотирьох всесвітньо відомих компаній\", - сказав Порошенко, при цьому саму фірму не назвав.\r\n\r\nВін зазначив, що РНБО зобов\'язала Укроборонпром надати необхідні документи, в тому числі йдеться про зняття грифа \"секретно\" і допуск аудиторів до інформації, яка є державною таємницею.'),
(5, '8c3d0250-411d-4ad3-9230-e244833d13b7', 'Країна не чекатиме, поки свою ділянку побудує Болгарія. Будівництво на сербській ділянці вже почалося.\r\n \r\nСербія розпочала будівництво ділянки трубопроводу Турецький потік для транспортування російського природного газу до Європи. Про це в середу, 17 квітня, заявив міністр закордонних справ країни Івіца Дачич, повідомляє Anadolu.\r\n \r\nУ ході прес-конференції в Москві, яка відбулася після зустрічі з главою МЗС РФ Сергієм Лавровим, Дачич заявив, що плани Сербії щодо будівництва газопроводу не залежать від прогресу Болгарії в завершенні своєї ділянки.\r\n \r\n\"Ми не чекатимемо, коли буде побудована болгарська частина. Ми вже почали будівельні роботи на сербській частині Турецького потоку\", - заявив Дачич.'),
(6, '07fa7286-de26-431e-9fa8-aab1f7c8151b', 'TurkStream транспортуватиме російський газ по трубопроводу під Чорним морем, обходячи Україну і далі - через Болгарію, Сербію та Угорщину.\r\n \r\n\"Ми обговорювали хід реалізації проекту TurkStream, зокрема, перспективи його продовження до Європи і, зокрема, в Сербію\", - сказав Лавров.\r\n \r\nСербське енергетичне агентство 5 березня схвалило будівництво сербської частини Турецького потоку. Планується, що будівництво трубопроводу довжиною 403 км завершиться до кінця року.\r\n \r\nНагадаємо, 19 листопада 2018 року президенти Туреччини і Росії Раджеп Таїп Ердоган і Володимир Путін запустили першу нитку газопроводу Турецький потік, що проходить по дну Чорного моря. У грудні на території Туреччини почалося будівництво наземної частини Турецького потоку.'),
(7, 'b57ba20d-c70b-4ed3-818f-88f8338a8ffb', 'Uber Shuttle - сервіс з бронювання місця в мікроавтобусі, який буде прямувати за низкою обраних напрямків в рамках Києва.\r\nКомпанія Uber планує в травні 2019 року запустити в Києві пілотний проект Uber Shuttle. Під час цього пілотного проекту користувачі зможуть забронювати через додаток Uber місце в мікроавтобусі, який курсуватиме одним із заздалегідь визначених напрямків.\r\n\r\nУ компанії зазначили, що основна мета пілотного проекту - використання технології Uber для пропозиції українським користувачам ще одного альтернативного способу пересування містом.\r\n\r\n\"Цей пілотний проект є частиною стратегії Uber з розширення можливостей мобільності, доступних на платформі\", - наголошують в Uber.'),
(8, 'df5ee091-b8ad-48d8-a00c-c6512f7a1114', 'У компанії взазначили, що Україна - дуже важлива для Uber, і компанія буде продовжувати інвестувати в країну, просуваючи на українському ринку нові продукти.\r\n\r\nКрім Києва, такий сервіс також доступний в Каїрі (Єгипет) і Монтерреї (Мексика).\r\n\r\nUber Shuttle - третя нова послуга, яку Uber запускає в Україні за останні півроку, після сервісу доставки їжі Uber Eats і сервісу Green з 100% подачею електромобілів.\r\n\r\nРаніше сервіс таксі Uber припинить свою діяльність в іспанській Барселоні через нові правила місцевого уряду.'),
(9, 'f0da78bf-41c4-4195-98d0-4c2982d5f3e4', 'Проти введення антиросійських санкцій \"за Азов\" виступали Італія і Фінляндія, але країнам-учасницям Євросоюзу вдалося знайти компроміс. Про це пише Європейська правда в середу, 17 квітня.\r\n \r\nВидання зазначає, що дебати про можливі санкції за агресію Росії в районі Азовського моря почалися відразу після нападу 25 листопада 2018 року. Але проти нових заходів виступала Німеччина, її підтримали Франція, Італія, інші члени ЄС.\r\n \r\n\"Узгодження навіть дуже символічних персональних санкцій стало великою проблемою, яка вимагала багаторівневі переговори між країнами ЄС\", - йдеться у статті.'),
(10, '3f623c36-e614-4649-8553-63dd3c89436a', 'За даними чиновників, нові санкції блокувала Фінляндія, яка домоглася виключення з санкцій переліку заступника керівника прикордонної служби ФСБ Росії, адмірала Геннадія Медведєва.\r\n \r\nПісля його заміни санкції з принципових мотивів заблокувала Італія, яка довгий час наполягає на необхідності скасування обмежувальних заходів проти РФ.\r\n \r\nЗа даними джерел видання, зняти вето Італії вдалося завдяки Литві.\r\n \r\n\"Офіційного підтвердження цих даних немає, але в дипломатичному співтоваристві ходять чутки, що для досягнення цього компромісу Литва прийняла п\'ять сімей сирійців, які прибули в Італію\", - йдеться в статті.'),
(11, '25ee3805-4eb7-4eb4-91ad-10b3ec2781fd', 'Як зазначається, на думку України, санкції проти Росії за напад і подальшу агресію в Азовському морі повинні бути абсолютно інші. Українська сторона наполягала на більш суворому покаранні для РФ.\r\n \r\n\"Київ навіть представив Брюсселю своє бачення під назвою \"Азовський пакет\", що включав обмеження проти компаній, російських портів і суден. Проте крім традиційних друзів на кшталт Литви і приєднаної до них Данії ця ідея не знайшла прихильників\", - стверджує автор статті.'),
(12, '0c811355-05ff-4779-8781-cc0d6102f398', 'Кандидат в президенти Володимир Зеленський вважає, що перед забороною російських соцмереж \"Вконтакте\" і \"Однокласники\", потрібно було провести роз\'яснювальну роботу і надати людям інші майданчики для спілкування.\r\n\r\nПро це він сказав в інтерв\'ю РБК.\r\n\r\nВідповідаючи на питання, чи зніме він заборону на російські соцмережі в разі його президентства, Зеленський зазначив, що люди вже сьогодні не дивляться на заборону, а обходять її.\r\n\r\n\"І чого ми досягли? Наші почали обходити заборону. Ця ситуація – я її називаю \"парковки в Києві\". У мене колись забирали машину, а зараз штрафують. Ти мені дай парковки, а потім жорстко мене карай, коли я не виконую закон. Точно така історія і тут. Ти дай людям платформу – ось де українці, де ми спілкуємося, де у нас однаковий світогляд – і \"хлопни\" ті\", - сказав Зеленський.'),
(13, '4b36740f-c9f6-449e-96c4-1e78be59426c', 'На репліку про те, що є Facebook, Twitter і YouTube, кандидат в президенти висловив думку, що \"значить, чогось недостатньо людям, раз вони обходять\".\r\n\r\n\"У чому взагалі наша історія, в чому наша проблема? Ми нічого не доносимо суспільству. Поясни і скажи людям: \"Люди, ось ви вважаєте, що це повинно працювати після того, що там надруковано?\". Вся громада скаже: \"Дякую, що ти мене запитав\". І погодяться з закриттям. Але спочатку потрібно в будь-якому рішенні згуртувати суспільство, пояснити why (чому, - ред.), запропонувати модель, а потім закривати\", - сказав Зеленський.'),
(14, '81137eaf-20b3-4c96-ad80-ad3d602d6c3b', '\"Я вважаю, що до цього питання потрібно підходити вибірково\", - сказав Зеленський, наводячи як приклад акторів Михайла Пореченкова та Івана Охлобистіна, які \"перетворилися в політиків, поїхали на Донбас, стріляли по наших пацанах\".\r\n\r\n\"Ці люди вже не артисти. Їм, звичайно, не повинен бути дозволений в\'їзд в Україну. Однозначно. Але якщо ми з вами беремо Макаревича – кожній такій людині, як Макаревич, соромно за те, що робить Кремль. Ну як ми можемо забороняти таким хлопцям в\'їзд? Або Лія Ахеджакова? Їм дуже складно. Тому до таких людей ми повинні бути відкриті. Для мене вони сьогодні великі українці, я їх такими вважаю\", - сказав Зеленський.\r\n\r\nВін також вважає, що уряд не повинен втручатися в роботу засобів масової інформації та в культурне життя.'),
(15, '92c348af-0eca-4a0b-a8fd-e1f944bf44d6', 'Кандидат у президенти Володимир Зеленський хотів би працювати не в Адміністрації президента на вулиці Банковій, а в якійсь іншій будівлі у стилі \"відкритого простору\".\r\n\r\n\"У нас є можливість розібратися з Адміністрацією президента, як мінімум\", – заявив він в інтерв’ю \"РБК-Україна\", говорячи про свої плани\r\n\r\n\"Чим там взагалі люди займаються зараз? Чому їх так багато? Куди йдуть такі гроші? Звідки такі бюджетні витрати на Адміністрацію?\", – додав Зеленський.\r\n\r\nНа запитання, чи з\'їде він із Банкової шоумен відповів: \"Дуже хочу\".\r\n\r\n\"Я сказав своїм хлопцям: шукаєте якийсь ореп space, якийсь unit цікавий... Так, я хочу. А її (будівлю Адміністрації президента – ред.), якщо дозволить суспільство, віддав би якійсь... Не знаю, не знаю...\", – сказав Зеленський.'),
(16, '96cba042-82f7-4823-beda-549188c5d42b', 'Кандидат запевнив, що не збирається керувати парламентом, тиснути на суддів або антикорупційні органи, але планує подавати законопроекти своєї команди у Верховну Раду.\r\n\r\n\"Я, як мінімум, буду це робити. Чесно кажучи, я розумію, що я можу втратити рейтинги, але ж суспільство побачить, що я роблю. Все, що я зможу зробити в рамках своїх повноважень, суспільство це побачить. Я думаю, воно повинно оцінити\", – сказав Зеленський.\r\n\r\nНа запитання, як він буде просувати те, \"чого хоче суспільство\", якщо цього не захоче підтримати Верховна Рада, він відповів: \"Я подаю законопроект про зняття недоторканності з депутатів, президента, суддів\".\r\n\r\n\"Не знімають. Це бачать люди?.. Все. Далі я зроблю таке звернення, після якого всі ці депутати побачать зустрічі з їхніми виборцями\", – змоделював ситуацію Зеленський.'),
(17, '843b3d3e-bca3-4b2d-a75a-c7c8fb8ce1db', 'Секретар Ради національної безпеки і оборони України Олександр Турчинов заявив, що ФСБ і ГУ Генштабу РФ повинні бути визнані терористичними організаціями, а Росія - державою, що розповсюджує тероризм у світі.\r\n\r\nПро це повідомляє прес-служба РНБО.\r\n\r\nЗа його словами, 17 квітня на спільному брифінгу Служби безпеки України та Генеральної прокуратури України \"були наведені неспростовні докази участі ФСБ та ГУ ГШ ЗС Російської Федерації в організації терактів на території України\".\r\n\r\n\"Силовими структурами нашої держави викрито створену спецслужбами держави-агресора агентурну мережу, яка несе відповідальність за серії терактів на території України, підривів та вбивств, зокрема, співробітників СБУ та ГУР МО України\", - сказав ТУрчинов.'),
(18, '0d76f520-bf62-4d26-a38b-25a145cce0c9', '\"Було затримано чинних співробітників спецслужб РФ, зізнання яких свідчать про цілеспрямовану організацію ФСБ та військовою розвідкою РФ терористичної діяльності на території нашої держави\", - додав він.\r\n\r\nСекретар РНБО підкреслив, що відповідно до отриманих доказів, відповідальність за організацію терору і диверсій на території України несуть директор ФСБ РФ генерал Олександр Бортніков, начальник департаменту контррозвідувальних операцій ФСБ генерал Дмитро Мінаєв, начальник ГУ ГШ ЗС РФ віце-адмірал  Ігор Костюков.'),
(19, '6696f7af-e2ee-4d6a-a37a-fcf7e98c5ced', 'Крім того Турчинов зазначив, що проти всіх осіб, причетних до організації та виконання терактів, відкрито кримінальні справи і ці особи мають бути внесені як терористи до бази Інтерполу, та до санкційних списків.\r\n\r\n\"Аналогічні злочини спецслужб РФ  було викрито і за межами нашої країни, - зокрема,  використання бойових отруйних речовин на території Великої Британії тощо\", - сказав він.\r\n\r\nЗа його словами, всі ці злочинні діяння дають підстави визнати спецслужби РФ, зокрема, ФСБ та ГУ ГШ ЗС РФ, терористичними організаціями, а Росію - державою, що розповсюджує тероризм у світі.'),
(20, '4f0345d3-1581-446e-a03d-3b831aff03e5', 'Кандидат у президенти України Володимир Зеленський заявив про підтримку євроатлантичного курсу України.\r\n\r\nПро це він сказав в інтерв’ю РБК-Україна, повідомляє \"Європейська правда\".\r\n\r\n\"Ви ж розумієте – ми вибрали напрямок в Європу, однозначно, ми хочемо бути не совком, ми хочемо бути європейською державою, так, так, так. НАТО – клас, безпека, рівень армії, все зрозуміло. Але я хочу об\'єднати країну\", - сказав Зеленський.\r\n\r\n\"Я буду кожен день записувати відео до східних регіонів України і говорити до них: подивіться, НАТО – не звірюка, і не проковтне вас. Дивіться, що це. Нехай люди думають, нехай почнуть читати про це, нехай почнуть вивчати\", - додав кандидат у президенти.'),
(21, '28a33e14-0f58-49bc-aa40-57d3501790ed', 'Міністерство енергетики та вугільної промисловості заявляє, що НАК \"Нафтогаз України\" може знизити ціни на газ для населення без скасування постанови Кабінету міністрів про спецзобов’язання.\r\n\r\nПро це повідомляє прес-служба Міненерговугілля.\r\n\r\n\"НАК \"Нафтогаз України\", згідно з постановою КМУ №293, зобов\'язана з травня знизити ціни на газ для населення\", - йдеться в повідомленні.\r\n\r\nНа думку юристів Міненерговугілля, для того, щоб продавати газ населенню дешевше, режим ПСО скасовувати не обов\'язково.\r\n\r\n\"Стаття 11 Закону України \"Про ринок природного газу\" не обмежує повноважень уряду за кількістю актів, які повинні бути прийняті щодо покладання спеціальних обов\'язків на суб\'єктів ринку\", - повідомляє Міненерговугілля.'),
(22, '229ffaa4-21c7-42e0-8d29-fd131f64a473', 'Медики надають допомогу постраждалим на місці, а також їх доставляють в міські лікарні.\r\nУ центрі столиці Словаччини Братиславі сталася ДТП за участю автобуса і тролейбуса. В результаті аварії 13 людей отримали травми різного ступеня тяжкості, повідомляє Pravda в четвер, 18 квітня.\r\n\r\nМедики надають допомогу постраждалим на місці, а також їх доставляють в міські лікарні, зазначила представник служби пожежної охорони Братислави Катаріна Крижанова.\r\n\r\nРух транспорту на вулиці Шанцевій, де сталася аварія, було перекрито. Збиток від аварії оцінюється в 50 тисяч євро.'),
(23, 'b2c9e99e-8a97-4256-ba7d-b7d086fae283', 'Глава Північної Кореї відвідає Російську Федерацію на запрошення президента Росії до кінця поточного місяця.\r\n \r\nПрезидент Росії Володимир Путін і його північнокорейський колега Кім Чен Ин зустрінуться в другій половині квітня. Про це в четвер, 18 квітня, повідомляє прес-служба Кремля.\r\n \r\nВідзначається, що Кім Чен Ин прибуде в Росію. Інші подробиці зустрічі не наведено.\r\n \r\nРаніше російські ЗМІ повідомили, що переговори лідерів РФ і КНДР можуть пройти наступного тижня у Владивостоці перед відльотом Володимира Путіна в Пекін на саміт Один пояс - Один шлях 26 - 27 квітня. При цьому джерело в МЗС додало, що Кім Чен Ин - \"людина імпульсивна\", і тому не виключені \"сюрпризи\".'),
(24, 'bbe87176-89e4-4833-90f2-b2ab2fefb4c9', 'Суд переніс розгляд запобіжного заходу для Ігоря Павловського, підозрюваного в організації вбивства Катерини Гандзюк, повідомляє сайт LB.ua.\r\n \r\nТаке рішення суддя ухвалила після того, як адвокати Павловського заявили, що він у лікарні. У зв\'язку з цим підозрюваного не доставили на засідання. Адвокат Максим Болдін заявив, що його підзахисному потрібна операція, інакше він може стати інвалідом першої групи. Тому захист клопотатиме про звільнення Павловського з-під варти.\r\n \r\nЗазначимо, що засідання перенесли вдруге. Вчора Павловського теж не змогли доставити в суд, окрім того, на засідання не з\'явився прокурор.\r\n \r\nСьогодні прокурор ГПУ Дмитро Боян повідомив, що Павловському змінили підозру: замість \"організації вбивства\" його дії перекваліфіковані на 396-у КК - \"приховування злочину\".'),
(25, '0b2d043d-35e5-45ae-8f61-6e7da27f0be3', 'Ювентус залишився без свого нападника Паулу Дібали, якому необхідно кілька тижнів для відновлення.\r\n \r\nЗа інформацією La Stampa, в аргентинця діагностували м\'язове ушкодження, через яке йому доведеться вибути до кінця квітня.\r\n \r\nТаким чином, гравець пропустить матчі з Фіорентиною та Інтером.\r\n \r\nДибала отримав травму в матчі проти Аякса в 1/4 фіналу Ліги чемпіонів.\r\n \r\nРаніше повідомлялося, що воротар Ювентуса перенесе операцію на плечі і вже не допоможе команді в цьому сезоні.'),
(26, '3b683179-df5e-4d78-b9eb-98296895e35b', 'Президент Франції Еммануель Макрон нагородив медалями пошани пожежників, які проявили хоробрість під час гасіння пожежі в соборі Паризької Богоматері. Про це в четвер, 18 квітня, повідомив телеканал BFM.\r\n\r\nЗазначається, що французький лідер прийняв 270 співробітників пожежної служби в четвер у Єлисейському палаці. Всього в боротьбі з вогнем участь взяли близько 400 пожежників.\r\n\r\nНагадаємо, 15 квітня в соборі Паризької Богоматері сталася сильна пожежа, яка тривала більше 12 годин. Будівлі завдано значної шкоди: завалився її шпиль, дах, колони в нефі і годинник.'),
(27, '5ba2860a-dbbf-4929-b9e1-570b5cff1eea', 'Вашингтон має намір закупити до 2024 року десять безпілотних надводних кораблів і дев\'ять великих роботизованих підводних човнів за $4 млрд, щоб не відставати від модернізації армій Китаю і Росії. Про це повідомило американське видання National Interest.\r\n \r\nКонтр-адмірал Ренді Крайтс уточнив, що роботизовані кораблі потрібні для виявлення загроз і атак. Серед переваг Крайтс виділив їх невеликий розмір, автономність і ціну.\r\n \r\nПри цьому допускається, що витрати на такий флот можуть збільшитися. Кораблі-дрони будуть менші, ніж звичайні кораблі, і більш доступні. Наразі Військово-морський флот США все ще розробляє свої вимоги до цих суден.\r\n \r\nСША також розробляють ракетний фрегат для управління флотилією безпілотних кораблів і підводних човнів.'),
(28, '0396ddae-dc48-4651-8870-77506cba71b5', 'Міністерство фінансів готує апеляцію на рішення суду, який визнав націоналізацію ПриватБанку незаконною. Про це повідомляє прес-служба Мінфіну в четвер, 18 квітня.\r\n\r\n\"18 квітня 2019 року Окружний адміністративний суд міста Києва за позовом колишнього співвласника ПриватБанку Ігоря Коломойського прийняв рішення, яким встановив процедуру виведення неплатоспроможного ПАТ КБ ПриватБанк з ринку за участю держави, що порушує норми чинного законодавства. Міністерство фінансів України не погоджується із зазначеним рішенням і готується до подання апеляційної скарги\", - йдеться в повідомленні.\r\n \r\nУ міністерстві стверджують, що рішення про виведення нібито неплатоспроможного ПриватБанку за участю держави приймалося відповідно до норм чинного законодавства, воно було підтримане РНБО й урядом України з метою забезпечення фінансової стабільності і збереження коштів громадян. \"Капітал ПриватБанку мав від\'ємне значення, і держава стала гарантом виконання всіх зобов\'язань перед клієнтами банку і збереження коштів громадян\", - зазначають у Мінфіні.'),
(29, '8b8c3502-1c24-4f99-8af8-1b92d826c723', 'У МВС заявили, що в день проведення дебатів між кандидатами в президенти Володимиром Зеленським та Петром Порошенком навколо НСК Олімпійський можуть обмежити рух транспорту, а також очікується велика кількість правоохоронців.\r\n\r\nЗа словами радника міністра внутрішніх справ Зоряна Шкіряка, ситуація буде залежати від того, коли стане зрозуміло, скільки громадян візьмуть участь в \"дійстві\", яке називається дебатами, які будуть домовленості між штабами кандидатів.\r\n\r\nШкіряк зазначив, що поки важко щось прогнозувати, переговори тривають.\r\n\r\nРазом з тим в МВС додали, що поліція буде охороняти стадіон і телеканал, де повинні проходити офіційні дебати, але точна кількість поліцейських, які повинні бути задіяні під час дебатів, також поки невідома.'),
(30, 'c479bc8e-1d4b-4761-bc90-faaf64b87055', 'Зірка розповіла про вихід власної документальної стрічки на Netflix і однойменного альбому.\r\n \r\nПопулярна співачка Beyonce анонсувала вихід власного документального фільму для платформи Netflix. Про це повідомляє CNN.\r\n \r\nПро швидкий вихід стрічки 37-річна співачка повідомила шанувальникам на своїй сторінці в Instagram.\r\n \r\nКартина буде назватися Homecoming (Повернення додому) і розповість про особисте життя, кар\'єру і виступ співачки на культовому фестивалі Coachella в 2018 році.'),
(31, 'c9df96eb-c8b5-4a73-9055-a6275de93e59', 'Радник президента США Фіона Гілл відвідала Росію для переговорів. Про це в четвер, 18 квітня, з посиланням на представника Кремля Дмитра Пєскова повідомляє АР.\r\n \r\nПєсков заявив у четвер, що спеціальний помічник президента США Дональда Трампа Фіона Гілл провела в середу в Москві переговори з декількома російськими чиновниками, зокрема з радником з питань зовнішньої політики президента Володимира Путіна.\r\n \r\nПредставник американського посольства, який побажав залишитися неназваним, оскільки заяви щодо візиту Гілл має робити Рада національної безпеки, підтвердив візит.\r\n \r\nПєсков заявив, що Гілл обговорила з російською стороною \"двосторонні питання\", але не обговорювала можливу зустріч Путіна з Трампом.'),
(32, 'adce7224-f583-4278-9d0d-5338920da946', 'Зокрема, заборона накладається на імпорт труб з чорних металів, в тому числі для нафто- і газопроводів. Крім того, в список увійшли деякі види паперу і картону (некрейдовані, багатошарові, гофровані, ручного відливу, крафт-папір та крафт-картон некрейдовані), а також картонки, ящики, коробки, мішки, пакети й інша пакувальна тара.\r\n\r\nКрім того, з України не можна буде ввозити взуття, костюми, сукні, спідниці, брюки, майки, фуфайки, светри, колготки, панчохи, гольфи, шкарпетки та інший одяг.\r\n\r\nУкраїна також не зможе отримувати з Росії техніку, зокрема, трубоукладальники вантажопідйомністю менш як 90 тонн, деякі моделі бульдозерів, одноковшові навантажувачі, а також жатки і запасні частини до них.'),
(33, '8e1b2f48-5182-4949-9aa7-c9e585cf2cd9', 'Зовнішнє незалежне оцінювання (ЗНО) у цьому році складатимуть 355 тисяч людей, про це йшла мова на нараді з підготовки до ЄДІ, основна сесія якого відбудеться 21 травня - 13 червня.\r\n \r\nУ нараді взяли участь представники Українського центру оцінювання якості освіти, Державної служби якості освіти, Міністерства освіти і науки, Міністерства охорони здоров\'я, Міністерства фінансів, Національної поліції, Державної служби з надзвичайних ситуацій і Міністерства інфраструктури.\r\n \r\nУчасники наради обговорили підготовку до проведення ЄДІ, у тому числі організацію посиленої охорони приміщень центрів оцінювання якості освіти і пунктів проведення тестування, безпечний підвіз учнів до пунктів проведення ЗНО, організацію роботи медпрацівників у місцях тестування, як і забезпечення належного фінансування проведення ЗНО.'),
(34, 'a565195d-1951-4d0e-baa6-f4b2ba9cd855', 'Заборона на експорт нафтопродуктів з РФ, оголошена сьогодні прем\'єр-міністром Росії Дмитром Медведєвим, не матиме серйозних наслідків для ринку України. Про це на своїй сторінці в Facebook у четвер, 18 квітня, написав директор консалтингової групи А-95 Сергій Куюн.\r\n \r\nЗа словами експерта, постанова, головним чином, стосується поставок дизельного палива і скрапленого газу. При цьому для заміщення за обома позиціями в України є потенціал. Однак для цього знадобиться певний час, протягом якого на ринку можуть спостерігатися цінові коливання. Зрештою, роздрібні ціни за обома видами палива незначно підвищаться, але ринок стане більш диверсифікованим і незалежним.'),
(35, '3ab071ea-5c47-4a84-a1e8-c74fb0470be3', 'Прикордонна служба Російської Федерації полегшила процедуру проходу іноземних суден в українські порти в Азовському морі. Про це УНН повідомив прес-секретар голови Державної прикордонної служби Олег Слободян.\r\n\r\n\"Зараз іноземні судна проходять через Керченську протоку, в українські порти в Азовському морі. Частина з них як і раніше оглядається представниками прикордонної служби Російської Федерації. Знову ж, зменшення контролю з боку РФ - це тимчасова ситуація\", - заявив Слободян.\r\n\r\nПри цьому, за його словами, в будь-який момент Росія може перекрити вхід суднам до Азовського моря.'),
(36, '79d8cbcc-4a54-49e5-8e63-a5f27f20efed', 'У Дніпрі бездомні випадково наткнулися на гранатомет у сміттєвому баку. Вони звернулися до перехожих з проханням викликати на місце поліцію. Про це в четвер, 18 квітня, повідомляє Інформатор.\r\n \r\nБоєприпас, візуально схожий на РПГ-22, лежав практично на дні бака. Патрульні, прибувши на місце, відразу ж взяли місце під охорону до приїзду спецслужб.\r\n \r\nПізніше з\'ясувалося, що знахідка не представляє небезпеки - тубус гранатомета виявився порожнім. Для вирішення питання про утилізацію снаряда на місце події викликали вибухотехніків.'),
(37, 'aeacc99e-fc16-4dbf-9fff-7b929ca9ddd1', 'Управління Державного бюро розслідувань у Миколаєві завершило досудове розслідування і передало до суду обвинувальний акт щодо трьох поліцейських, підозрюваних у тортурах. Про це повідомив прес-секретар Генеральної прокуратури Андрій Лисенко на своїй сторінці у Facebook.\r\n \r\nВстановлено, що 22 лютого минулого року троє поліцейських на прохання місцевого жителя, перевищуючи службові повноваження, проникли в будинок потерпілого, завідомо незаконно його затримали і доставили у відділення, де застосовували фізичне насильство, вибиваючи з нього зізнання в крадіжці.'),
(38, 'f28e4b49-ece8-4201-a313-f28e2d1dcc41', 'Зазначається, що 17 квітня обвинувальний акт був направлений для розгляду до Ленінського районного суду Миколаєва. Підтримання державного обвинувачення в цьому провадженні доручено прокуратурі Миколаївської області.\r\n \r\nНапередодні повідомлялося, що в Дніпрі поліцейський отримав довічний термін. Чоловік погрожував одній із власниць квартири і вистрілив у голову перехожому за те, що втрутився.\r\n \r\nРаніше повідомлялося, що в Києві за тортури праскою затриманого екс-міліціонерам дали умовний строк. Двоє колишніх співробітників Святошинського райвідділу міліції били і катували розігрітою праскою затриманого.'),
(39, '4c0e6619-1fca-4cef-87db-d6f72aa38a86', 'Укрпошта до 80-річчя від дня народження видатного футболіста і тренера Валерія Лобановського ввела в обіг поштову марку і випустила тематичний конверт.\r\n\r\nУрочиста церемонія спецпогашення відбулася 18 квітня в Будинку Футболу за участю володаря \"Золотого м\'яча\" Ігоря Бєланова, футболістів і тренерів Олексія Михайличенка і Володимира Безсонова.\r\n\r\nМарка Валерій Лобановський. 1939-2002 рр. випущена тиражем 130 тисяч примірників, її вартість 8 гривень, і з 18 квітня знак поштової оплати можна буде придбати в спеціалізованих точках продажу філателістичної продукції.'),
(40, 'b63fbe25-9eaa-493a-af5b-735304f80a8e', 'Шевченківський районний суд Києва ухвалив рішення про відмову в знятті арешту з ряду рахунків ліквідованого банку Всеукраїнський банк розвитку (ВБР), який належав синові екс-президента Віктора Януковича Олександру. Про це в Facebook повідомила прес-секретар генпрокурора України Юрія Луценка Лариса Сарган.\r\n \r\nВідзначимо, що на вчорашньому засіданні суд зняв арешт з рахунків банку Януковича. Прокурори приготували термінові клопотання, і нове засідання у цій справі відбудеться у четвер, 18 квітня.\r\n \r\n\"Тільки що суддя Шевченківського райсуду Є.Мартинов постановив відмовити у знятті арешту з ряду рахунків банку ВБР\", - повідомила Сарган.'),
(41, '20d0277e-93e1-4674-8651-416a80155706', 'Вести дебати кандидатів у президенти Володимира Зеленського та Петра Порошенка, які відбудуться о 19:00 на НСК Олімпійський, будуть журналісти Андрій Куликов, запропонований штабом Порошенка, і Олена Фроляк від штабу Зеленського. Про це в п\'ятницю, 19 квітня, повідомляє Українська правда з посиланням на джерело, близьке до переговорів.\r\n\r\nЗа даними видання, дебати розпочнуться з 5-хвилинних виступів кожного з кандидатів, після цього кожен відповість на 3 питання модераторів, у них буде по 1 хвилині, щоб поставити своє, і по 5 хвилин, щоб відповісти на питання опонента.'),
(42, 'dc0ae0e5-6ee4-49c5-bc74-1e70b3db6dd3', 'Від Порошенка і Зеленського буде по троє артистів, які виступлять по черзі, поки на стадіон будуть заходити люди.\r\n\r\n\"Водночас, джерела як в команді Порошенка, так і в команді Зеленського скаржаться один на одного. У групі Порошенка УП сказали, що \"зелені йдуть по беззаконню\", а в команді Зеленського звинувачують штаб опонента в регулярному висуненні нових умов: \"вони постійно щось змінюють, щогодини нову умову\", - йдеться в повідомленні.\r\n\r\nУ команді Порошенка додали, що стосовно ведучих ще йдуть переговори. Команда президента наполягає, щоб модератори могли поставити кандидатам більше 3 питань, зазначає видання.\r\n\r\nЯк відомо, дебати на стадіоні розпочнуться о 19:00. Перед дебатами - о 16:00 - заплановані концерти.'),
(43, 'da19a0fe-cfbe-4316-a89a-7b04251d05c1', 'Серія пенальті в матчі Шахтар-Динамо стала рекордним футбольним відео з України на YouTube.\r\nДраматичний чвертьфінал Кубка України, в якому донецький Шахтар обіграв київське Динамо в серії пенальті (4:3), встановив рекорд і за кількістю переглядів в мережі.\r\n\r\nТак, відео переможної для гірників футбольної лотереї, головним героєм якої став воротар Андрій П’ятов, набрало 900 881 перегляд і стало найпопулярнішим за весь час існування YouТube-каналу Шахтар, випередивши навіть трансляції ігор.\r\n\r\nКілька днів це відео трималося в топ-15 продуктів українського сегменту хостингу. На сьогоднішній день це найпопулярніший ролик серед усіх коли-небудь розміщених на клубних YouТube-каналах країни.'),
(44, 'b5c363b1-2a37-4890-88a1-2a37dacfd8e5', 'Вихід гаджета на ринок повинен відбутися в наступному місяці. Пристрій отримає потрійну основну камеру.\r\nУ Мережі було опубліковано відео, присвячене камері нового флагманського смартфона Sony. Вихід його повинен відбутися в наступному місяці. Про це пише GSMArena.\r\n\r\nЦей гаджет повинен стати першим для компанії, оснащеним потрійною камерою. Вона включає в себе наступні сенсори: надширококутний зі світлосилою f/1.6, просто ширококутний (f/2.4) і портретний (f/2.4).\r\n\r\nНовинка також отримала 6,5-дюймовий дисплей з роздільною здатністю 4K і підтримкою HDR.'),
(45, '508db3b4-94e7-40ba-a33c-e63c8f607a22', 'У НБУ заявляють, що судова справа про націоналізацію Приватбанку не стосується вкладників банку, а тільки нинішніх власників і колишніх акціонерів. Про це написав глава ради Національного банку Богдан Данилишин у Facebook.\r\n\r\n\"Рішення Окружного адміністративного суду міста Києва не матиме істотного впливу ні на стан економіки України, ані на роботу банківської системи. Теперішня реакція фінансових ринків на подію є тимчасовою\", - стверджує Данилишин.\r\n\r\n\"Надалі обов\'язково буде апеляційний розгляд, який може розтягнутися на кілька років. Судовий спір не стосується вкладників Банку, а тільки нинішніх власників і колишніх акціонерів\", - написав глава ради НБУ.\r\n\r\n\"Як показав вчорашній день, за подіями навколо Приватбанку спостерігає не тільки МВФ, а весь світ. Нам дуже важливо не тільки забезпечити стабільність системи, але і не розгубити довіру наших кредиторів, разом з якими ми досягли фінансової стабільності. Упевнений, що злагоджені дії НБУ, уряду і РНБО вбережуть українців від непотрібних втрат і фінансових потрясінь\", - упевнений Данилишин.'),
(46, '06734556-3baf-4322-b01f-0ad4ae805d38', 'В Одеській області 13-річний хлопчик отримав сильні опіки від ураження електрострумом на даху залізничного вагона.\r\n\r\nЯк повідомили в Головному управлінні Національної поліції Одеської області, попередньо встановлено, що 18 квітня дитина перебувала на залізничній станції в районі села Дачне.\r\n\r\nВона вилізла на дах залізничного вагона і торкнулася оголеного дроту лінії електропередач. В результаті отримала ураження електричним струмом і впала з даху вагона.\r\n\r\n\"13-річну дитину госпіталізовано з попереднім діагнозом: ураження електричним струмом 80% тіла та іншими травмами\", - повідомили в поліції.\r\n\r\nНа місці працювала слідчо-оперативна група. Поліцейські встановлюють обставини події і вирішують питання про її кваліфікацію.'),
(47, '39269635-eb70-4853-80bc-954e37b1f47a', 'Російський уряд широко і систематично втручався в президентські вибори 2016 року. Розслідування виявило \"численні зв\'язки між урядом Росії і кампанією Дональда Трампа\".\r\n \r\nРозслідування встановило, що уряд Росії вірив, що отримає вигоду від президентства Трампа, і працював над тим, щоб домогтися такого результату, а представники штабу Трампа очікували, що виграють електорально завдяки інформації, вкраденій і розкритій зусиллями російської влади.\r\n \r\nВ основі російського втручання, виявив Мюллер, лежать дві операції: кампанія в соціальних мережах, \"покликана розпалити і поглибити політичну і соціальну ворожнечу в США\", і злом комп\'ютерів Демократичної партії і злиття їхнього листування, щоб \"кинути на них тінь\".\r\n \r\nЗа даними команди Мюллера, свою кампанію з дезінформації в соціальних мережах Росія почала готувати ще у 2014 році. У середині 2016 року були виявлені перші ознаки втручання російського уряду в американську політику.'),
(48, 'f9bbfd16-2810-4f26-b121-661c1a53a2c7', '13 росіян і дев\'ять юросіб, у тому числі Агентство інтернет-досліджень, Concord Management and Consulting і Concord Catering, звинувачуються у створенні підроблених акаунтів у соцмережах, включаючи Twitter і Facebook. Вони організовували політичні акції з метою посіяти ворожнечу серед американців, а з 2016 року підтримували Дональда Трампа.\r\n \r\nДехто із співробітників цих компаній із Санкт-Петербурга навіть їздив у США для збирання інформації та фотографій для своїх постів. Декому з них Мюллер висунув звинувачення в минулому році.\r\n \r\nПід час розслідування було встановлено, що хакерську атаку на членів Демократичної партії США зробили агенти ГРУ, а отримані дані відправили у WikiLeaks.\r\n \r\nАле розслідування не підтвердило, що штаб Трампа змовився з російською владою або координував з ними їхню діяльність по втручанню у вибори.\r\n \r\nДоведено, що між високопоставленими співробітникам штабу Трампа, включаючи сина майбутнього президента, і WikiLeaks йшла жвава переписка і координація дій. Але немає доказів усвідомленої співпраці з російською розвідкою.'),
(49, '84e54a2d-91e0-4d8b-a84b-c819b1969889', 'У звіті Мюллера згадується декілька нереалізованих ініціатив зі зміни американського зовнішньополітичного курсу.\r\n \r\nСлідчі звернули увагу на візит до Москви колишнього радника Трампа Картера Пейджа в липні 2016 року і зустріч у Нью-Йорку між Полом Манафортом і його бізнес-партнером Костянтином Килимником, якого в США вважають співробітником російських спецслужб.\r\n \r\nПід час переговорів Килимник, як говориться в доповіді, запропонував керівнику виборчого штабу Трампа власний план мирного врегулювання в Україні, який міг би стати запасним для управління Донбасом Кремлем.\r\n \r\nПізніше, як уточнює спецпрокурор, в офіційній платформі Республіканської партії були \"значно пом\'якшені\" формулювання параграфа, який стосується конфлікту на сході України.\r\n \r\nТак, Килимник передав Манафорту пропозицію \"від екс-президента України Віктора Януковича\", у якому пропонувалося створення в індустріальних районах Донбасу автономної республіки.\r\n \r\n\"План Януковича\" обговорювався до минулої весни, але доказів того, що Манафорт передав його Трампу або комусь з оточення президента, немає. Правда, слідчі підкреслили, що Манафорта вже ловили на брехні під присягою.'),
(50, '3628d96d-9f64-4816-93e5-12c3c62ccb87', 'Однією з найбільш цитованих частин доповіді стала та, у якій описується реакція Трампа на призначення Роберта Мюллера спецпрокурором з розслідування зв\'язків його команди з Кремлем.\r\n \r\n\"Це кінець мого президентства. Мені гаплик (I\'m fucked)\", - процитував Трампа глава Мін\'юсту США у 2017-2018 роках Джефф Сешнс, який і приніс цю новину президенту.\r\n \r\nПісля публікації доповіді Трамп назвав розслідування \"змарнованим\" часом, протягом якого воно велося.\r\n \r\n\"У мене було право покласти край полюванню на відьом, тільки б я захотів\", - написав Трамп у своєму мікроблозі Twitter, зазначивши, що \"міг би звільнити всіх, включаючи Мюллера\".\r\n \r\nВін підкреслив, що висновки команди Мюллера доводять безпідставність звинувачень на його адресу.\r\n \r\n\"Змови немає. Перешкоджання [правосуддю] немає. Усім злостивцям і радикальним лівим з числа демократів: GAME OVER\", - йдеться на зображенні, яке Трамп опублікував у Twitter в стилі серіалу Гра престолів.\r\n \r\nЧлени юридичної команди Дональда Трампа назвали публікацію доповіді \"повсюдною перемогою президента\".'),
(51, '9908598c-116f-4be8-814b-3de945381bc1', 'Прес-секретар президента Росії Дмитро Пєсков заявив, що доповідь не містить ніяких \"аргументованих доказів\", що таке втручання Москви в американські вибори дійсно було.\r\n \r\n\"Ми, як і раніше, не приймаємо подібних звинувачень. Від самого початку ми говорили, що хоч чим займатимуться слідчі, вони не знайдуть аргументів втручання. І президент Путін, зокрема, говорив про це, бо такого втручання не було. Власне, публікація вкотре це підтверджує\", - сказав він.\r\n \r\nЗа словами Пєскова, у доповіді Мюллера взагалі немає ніякої нової інформації, усі викладені в документі дані раніше публікувалися в інших джерелах.\r\n \r\nВін також сказав, що в Кремлі шкодують про те, що на й без того не найкращі відносини Росії і США безпосередньо впливають \"такої якості документи\".\r\n \r\nНапередодні представник МЗС Росії сказав, що автори доповіді \"фактично розписалися в тому, що в них таких доказів немає\".'),
(52, 'f5139a21-cc6c-47d8-9473-8440966fc332', 'Один з жителів Індії під час голосування на парламентських виборах поставив \"галочку\" за правлячу партію, прихильником якої він не є. Після цього представник касти недоторканних відрізав собі палець, пише місцева газета Hindustan Times.\r\n\r\nУ другому етапі парламентських виборів йде боротьба між двома політичними партіями: правлячою Бхаратія джаната парті, на чолі якої стоїть чинний в країні прем\'єр-міністр Нарендра Моді, і партією Індійський національний конгрес, глава цієї партії виходець з впливового політичного клану Рахул Ганді.\r\n\r\n25-річний Паван Кумар помилково віддав свій голос першій партії, але був прихильником ще однієї партії зі схожою назвою Бахуджан самадж парті. Для БСП, за даними джерела, дуже значимі голоси касти недоторканних. Щоб спокутувати свою провину, чоловік позбавив себе кінцівки і записав відео в соцмережах, де пояснив вчинок.\r\n\r\nСправа в тому, що на палець кожного виборця в Індії ставлять незмивний знак - він показує те, що людина вже віддала свій голос.'),
(53, '7c91a4f7-6065-44d4-8901-666176a6cfb3', 'Напередодні другого туру президентських виборів Київ масово обклеїли агітацією провокаційного характеру проти Володимира Зеленського, повідомляють завсідники Facebook.\r\n \r\nЗа їхніми словами, антирекламу кандидата в президенти клеять на лавочки, стовпи і паркани. Також соцмережею \"ширяють\" картинки з написом \"Не вигонь наркомана з під\'їзду, можливо, це твій майбутній президент\" і обличчям Зеленського. Оповідні плакати кидають у поштові скриньки і клеять на стіни ліфтів у житлових будинках.Один з дописувачів повідомив, що подібна картина спостерігається в Одесі.'),
(54, '71671229-34df-463e-a082-456ab4e017c6', 'Двоє людей постраждали під час збройного нападу на філію банку Liberty на околиці Тбілісі майже відразу ж після його відкриття сьогодні вранці, 19 квітня, повідомляють місцеві ЗМІ.\r\n \r\nЗловмисники увірвалися до відділення Liberty, розташованого на першому поверсі багатоквартирного будинку. Очевидці кажуть, що чули декілька пострілів.\r\n \r\nЗа попередньою інформацією, двоє постраждалих є співробітниками банку. Імовірно, травми вони отримали під час чинення опору нападникам.\r\n \r\nГрабіжникам, кількість яких не встановлена, вдалося ушитися. Поки невідомо, чи змогли вони забрати гроші.\r\n \r\nТериторія навколо банку оточена, працюють експерти-криміналісти.'),
(55, 'be59f76b-ae59-4fb3-8914-a46d345c451b', 'Президент Білорусі Олександр Лукашенко у своєму щорічному посланні до білоруського народу і парламенту запропонував призначати на високі посади лише багатодітних батьків. Про це в п\'ятницю, 19 квітня, повідомляє Інтерфакс.\r\n \r\n\"Подивіться на себе - скільки у вас дітей... Ми думаємо: не служив в армії - не пускаємо на держслужбу. Нема трьох (дітей), як у Румаса (прем\'єр-міністр країни Сергій Румас, - ІФ) четверо, - не може бути міністром або ще там кимось\", - заявив він.\r\n \r\nПрезидент Білорусі також заявив, що пільгове житло в першочерговому порядку має виділятися багатодітним сім\'ям.\r\n \r\n\"Народила (жінка в багатодітних сім\'ях. - ІФ) - давайте разом виховувати. Завтра жити нікому буде за такої тенденції\", - додав президент.\r\n \r\nРаніше президент Білорусі заявив, що в країні \"з мужиками біда\", і попросив білоруських жінок народжувати більше дітей.\r\n \r\n\"Побільше дітей. Це і для жінок, і для нас, мужиків, і для країни дуже важливо. Ну, вам же просто: двоє дітей - це ваші, третій - це мій\", - сказав Лукашенко 1 березня в ході зустрічі з представниками громадськості та ЗМІ в Мінську, пообіцявши багатодітним сім\'ям \"безпрецедентну\" підтримку.'),
(56, 'e157ae9a-d984-4fa8-820c-487cc795fe05', 'Сотні американців повідомили про \"кулю, що світиться\" в нічному небі. Фахівці кажуть, що вона була яскравішою за Венеру.\r\nУ нічному небі над США пролетів великий метеор, який залишив синьо-зелений слід в небі. Про це безліч очевидців повідомили на своїх сторінках в соцмережах.\r\n\r\nАмериканці стверджують, що небесне тіло світилося дуже яскраво, залишаючи за собою яскравий синьо-зелений слід. Метеор нагадував \"кулю, що світиться\", схожу на кульову блискавку.\r\n\r\nАмериканське метеорне товариство повідомило про надходження 325 повідомлень про метеор.'),
(57, '7d90e9d6-a52f-44a8-a540-779f3aa2f1ca', 'Мешканці сусіднього будинку зняли на відео нічний погром. Самого хулігана на ролику не видно, зате чітко чути гуркіт.\r\n \r\nНевідомий в Одесі кидав з вікна каструлі і сковорідки на припарковані під будинком автомобілі. Про це в п\'ятницю, 19 квітня, повідомляє Одесса.net.ua.\r\n \r\nДивний гуркіт розбудив перед світанком жителів вулиці Розумовської. Як виявилося, гуркотіло кухонне приладдя - каструлі і сковорідки, які летіли з вікна багатоповерхівки в припарковані авто.\r\n \r\nХто і навіщо викидав посуд вночі з вікна, не повідомляється, як і не згадується про масштаби пошкоджень авто.'),
(58, '6ab85d4a-b9ca-42da-a479-416a208f4bcd', 'Управління Верховного комісара ООН у справах біженців (УВКБ) почало евакуацію біженців з Лівії. Про це повідомляє прес-служба організації в п\'ятницю, 19 квітня.\r\n\r\n \r\n\"УВКБ евакуювала близько 163 біженців з Лівії до Нігеру в ході першого такого рейсу з тих пір, як два тижні тому в лівійській столиці посилилися бої. Рейс був раніше в п\'ятницю\", - йдеться в повідомленні.\r\n \r\nВсього в центрах, які знаходяться близько до місць боїв, знаходяться ще понад три тисячі біженців і мігрантів.\r\n \r\n\"Солідарність Нігеру, який прийняв цих біженців, гідна наслідування, але країна не може робити це наодинці. Повинна бути колективна відповідальність, нам потрібно, щоб інші країни відгукнулися на заклик, прийшли на виручку і допомогли незахищеним біженцям вибратися з Лівії в безпечне місце\", - заявив верховний комісар ООН у справах біженців Філіппо Гранді.'),
(59, '3018e1e4-2368-4306-975a-67e6b0bfe127', 'У матчі-відповіді з Манчестер Юнайтед аргентинець відзначився двома голами.\r\nНападаючий Барселони Ліонель Мессі визнаний найкращим гравцем тижня в Лізі чемпіонів за підсумками чвертьфінальних матчів. Про це повідомляє прес-служба УЄФА.\r\n\r\nНагадаємо, що аргентинець відзначився двома забитими м\'ячами в матчі-відповіді з Манчестер Юнайтед (3:0).\r\n\r\nМессі в голосуванні обійшов півзахисника Тоттенхема Сон Хин Міна, нападаючого Ліверпуля Роберто Фірміну і захисника Аякса Маттейса де Лігта.'),
(60, 'dc6fcbb1-4184-41f7-b97b-8a06133ede5a', 'Європейський Союз шкодує з приводу відсутності \"серйозних дебатів\" між кандидатами у президенти Петром Порошенком і Володимиром Зеленським перед другим туром виборів. Про це заявив глава представництва ЄС в Києві Хюг Мінгареллі, виступаючи перед європейськими спостерігачами, які прибули на другий тур виборів, повідомляє в п\'ятницю, 19 квітня, Радіо Свобода.\r\n \r\nПосол ЄС вважає це \"неповагою до виборців\".\r\n \r\n\"Кандидати повинні погодитися на проведення серйозної дискусії, щоб виборці були забезпечені інформацією про політичні орієнтири претендентів\", - сказав він.\r\n \r\nПередбачається, що о 19:00 на НСК Олімпійський прийде Зеленський, хоча, за законом, дебати повинні пройти в студії Суспільного часом пізніше - о 20:00. Проте, дебати на телебаченні перенесли на годину вперед - на 21:00. Однак, у Зеленського не впевнені, що він туди прийде. Порошенко раніше стверджував, що згоден дискутувати з суперником у будь-який вільний від роботи час.'),
(61, '9f082490-648f-4152-bf9a-f7e099c2493c', 'Шевченківський районний суд міста Києва переніс на 22 квітня засідання з розгляду клопотання про зміну запобіжного заходу Ігорю Павловському, який є одним з фігурантів справи про вбивство активістки Катерини Гандзюк, передає УНІАН.\r\n\r\nЯк повідомляється, сьогодні засідання суду знову не відбулося. Підозрюваного Павловського не доставили до зали суду. Ні адвокату Максиму Болдіну, ні судді Олені Мелешак невідоме місце перебування підозрюваного.\r\n\r\nСуддя зазначила, що вперше Служба безпеки ігнорує запит суду щодо місця перебування підозрюваного.\r\n\r\nБолдін додав, що кілька днів тому в ізоляторі тимчасового тримання СБУ Павловський впав і отримав струс мозку, після чого його відвезли в лікарню на \"швидкій\".\r\n\r\nОднак, за словами Болдіна, в СБУ не дають інформацію, де перебуває його підзахисний. Болдін готує щодо цього адвокатський запит.\r\n\r\nТакож суддя Мелешак прийняла рішення на наступне засідання викликати слідчого СБУ у справі Гандзюк, щоб той повідомив суду місце перебування Павловського і пояснив, чому в СБУ не відповідають на запити суду.');
